import React from "react";
import TopNav from "../components/Navbar/TopNav";
import dplant from  "../images/plants/dplant1.png"
import { useNavigate } from 'react-router-dom';
const PlantProfile = () => {

    const history = useNavigate();

    function handleClick() {
        history('/sellerprofile');
    }
    function favoritos() {
        history('/favourites');
    }
    function cart() {
        history('/cart');
    }

    return(
        <div className="full_div">

            <TopNav></TopNav>
            <center>
            <div style={{ marginTop:'20px' ,border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '80%' }}>
                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '100%', margin: '0 auto' }}>

                    <div><img src={dplant} alt="Maria Florista" style={{ width: '100', height:'30%' , objectFit: 'cover' }} /></div>
                    <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '100%' }}>   
                        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '100%', margin: '0 auto' }}>   
                            <div>
                                <div><h4>Commun Name : Dragon Plant</h4></div>
                                <div><h4>Cientific Name: Dracaena deremensis</h4></div>
                                <div><h4>Kingdom/Family: Plantae/Asparagaceae</h4></div>
                                <div>
                            </div>
                            </div>
                            <div>
                                <div>
                                    <div><h3>Only:</h3></div>
                                    <div><h1>20,00 €</h1></div>  
                                    <div><h3>No shipping</h3></div>  
                                </div>
                            </div>
                            <div style={{height:'100%'}}>
                                <div>
                                    <button style={{ marginRight: '10px', backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer',marginTop:'30px' } } onClick={cart}>Add to cart</button>
                                </div>
                                <div>
                                    <button style={{ marginRight: '10px', backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer', marginTop:'10px' } } onClick={handleClick}>Visit Seller</button>
                                </div>
                                <div>
                                    <button style={{ marginRight: '10px', backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer', marginTop:'10px' } } onClick={favoritos}>Add to favorites</button>
                                </div>
                            </div>
                         </div>
                    </div>
                </div>
                    <div style={{ marginTop:'10px'}}><h2>Description:</h2></div>
                    <div><h3>Dracaena marginata, more commonly known as a dragon tree, is an attractive plant with green sword-like,red-edged leaves. Native to Madagascar, the eye-catching spiky tree is known as a great entry plant for household gardeners—it's easy to care for, drought-tolerant, and nearly indestructible.</h3></div>
                </div>
                </center>
        </div>
    );
}
export default PlantProfile;
